(37, 2, 'A.806 Bộ móng tay giả đính chi tiết nổi Bow fruit heart kèm keo S156 set10', '💅 Bộ móng tay giả với thiết kế đính chi tiết nổi Bow – Fruit – Heart dễ thương và độc đáo, mang lại vẻ ngoài ngọt ngào và cuốn hút.\r\n✨ Phong cách trẻ trung, phù hợp cho những bạn thích sự điệu đà và nổi bật trong từng chi tiết.\r\n📦 Set gồm 10 móng + keo dán tiện lợi, dễ dàng thực hiện tại nhà, giúp bạn có ngay bộ móng xinh xắn mà không cần ra tiệm.\r\n🌸 Chất liệu móng cao cấp, ôm khít tự nhiên, bền đẹp, không gây khó chịu khi sử dụng.\r\n🌟 Thích hợp cho nhiều dịp: đi học, đi chơi, dự tiệc, hẹn hò… giúp bạn thêm phần tự tin và tỏa sáng.', 55000.00, 6, 1, '2025-09-23 12:49:49', '2025-09-23 12:49:52'),
(38, 2, 'A.806 Bộ móng tay giả Black and white cat nền họa tiết kèm keo E31 set10', '🐾 Bộ móng tay giả với thiết kế Black and White Cat trên nền họa tiết độc đáo, mang lại phong cách dễ thương nhưng vẫn thời trang.\r\n🎨 Tông màu đen – trắng kinh điển, phối hợp tinh tế, phù hợp cho nhiều phong cách từ cá tính đến nữ tính.\r\n📦 Set gồm 10 móng + keo dán tiện lợi, dễ dàng sử dụng tại nhà, tiết kiệm thời gian mà vẫn có bộ móng xinh như làm ở tiệm.\r\n💅 Chất liệu móng chắc chắn, ôm khít tự nhiên, thoải mái khi đeo và dễ tháo gỡ khi cần.\r\n🌟 Thích hợp để đi chơi, chụp ảnh, hẹn hò hay làm điểm nhấn trong những dịp đặc biệt.', 45000.00, 50, 1, '2025-09-23 12:50:09', '2025-09-23 12:50:13'),
(39, 2, 'A.806 Bộ móng tay giả Sanrio family Hello Kitty face nơ nhỏ kèm keo E17 set10', '🎀 Bộ móng tay giả với thiết kế Sanrio Family – Hello Kitty face dễ thương, điểm xuyết nơ nhỏ xinh xắn tạo phong cách ngọt ngào và nữ tính.\r\n🌸 Tông màu nhẹ nhàng, tinh tế, phù hợp cho nhiều dịp từ đi học, đi làm đến dạo phố hay hẹn hò.\r\n📦 Set gồm 10 móng + keo dán tiện lợi, dễ dàng gắn tại nhà, nhanh chóng có ngay bộ móng đáng yêu mà không cần ra tiệm.\r\n💅 Móng chắc chắn, bám tốt, thiết kế ôm khít tạo cảm giác tự nhiên và thoải mái khi sử dụng.\r\n✨ Lựa chọn hoàn hảo cho các tín đồ Hello Kitty và những ai yêu thích phong cách cute – nữ tính.', 45000.00, 41, 1, '2025-09-23 12:50:22', '2025-09-23 12:50:25'),
(40, 2, 'A.806 Bộ móng tay giả Ombre blink star cherry WY151 set10', '✨ Bộ móng tay giả Ombre Blink Star Cherry với hiệu ứng ombre chuyển màu mềm mại, điểm xuyết họa tiết ngôi sao lấp lánh và cherry xinh xắn, mang đến vẻ ngoài vừa ngọt ngào vừa nổi bật.\r\n🌸 Thiết kế thời trang, dễ phối với nhiều phong cách từ nữ tính, đáng yêu đến cá tính nhẹ nhàng.\r\n💅 Chất liệu móng chắc chắn, ôm khít tự nhiên, dễ dàng gắn và tháo mà không làm hại móng thật.\r\n📦 Set gồm 10 móng tay + keo dán tiện lợi, giúp bạn nhanh chóng có bộ móng xinh tại nhà mà không cần ra tiệm.\r\n🌟 Lý tưởng cho các buổi đi chơi, dự tiệc, hẹn hò hoặc làm điểm nhấn cho phong cách hằng ngày.', 65000.00, 35, 1, '2025-09-23 12:50:28', '2025-09-23 12:50:39'),
(41, 2, 'A.806 Bộ móng tay giả Ocean starfish WY559 set10', '🌊 Bộ móng tay giả Ocean Starfish lấy cảm hứng từ đại dương, với tông màu xanh trong trẻo và họa tiết sao biển độc đáo tạo cảm giác tươi mới, mát lành.\r\n✨ Thiết kế tinh tế, dễ dàng kết hợp cùng nhiều phong cách thời trang, mang lại vẻ ngoài nổi bật và đầy sức sống.\r\n💅 Chất liệu móng bền đẹp, ôm khít tự nhiên, dễ dàng dán và tháo mà không gây hại cho móng thật.\r\n📦 Set gồm 10 móng tay + keo dán tiện lợi, giúp bạn nhanh chóng sở hữu bộ móng đẹp ngay tại nhà.\r\n🌟 Phù hợp cho đi biển, dạo phố, dự tiệc hay những dịp đặc biệt cần điểm nhấn ấn tượng.', 55000.00, 30, 1, '2025-09-23 12:50:35', '2025-09-23 12:50:42'),
(42, 2, 'A.806 Bộ móng tay giả Flower wavy line kèm keo WY808 set10', '🌸 Bộ móng tay giả Flower Wavy Line với thiết kế hoa xinh xắn kết hợp đường uốn lượn mềm mại, mang đến vẻ ngoài nữ tính và hiện đại.\r\n✨ Tông màu hài hòa, dễ phối cùng nhiều phong cách trang phục, giúp đôi tay trở nên thanh thoát và nổi bật.\r\n💅 Chất liệu móng bền đẹp, ôm khít tự nhiên, không gây khó chịu khi đeo lâu.\r\n📦 Set gồm 10 móng tay + keo dán tiện lợi, dễ dàng sử dụng tại nhà chỉ trong vài phút.\r\n🌟 Phù hợp cho đi học, đi làm, dạo phố hay những buổi tiệc nhẹ, tạo điểm nhấn tinh tế cho đôi bàn tay.', 55000.00, 26, 1, '2025-09-23 12:50:54', '2025-09-23 12:50:57'),
(43, 2, 'A.806 Bộ móng tay giả Bow nơ phối màu kèm keo WY080 set10', '🎀 Bộ móng tay giả Bow nơ phối màu mang đến phong cách ngọt ngào, nữ tính với điểm nhấn là những chiếc nơ xinh xắn nổi bật.\r\n✨ Thiết kế phối màu hài hòa, giúp đôi tay trở nên thanh thoát và cuốn hút trong mọi hoàn cảnh.\r\n💅 Chất liệu móng nhẹ, bám chắc, ôm khít tự nhiên, mang lại cảm giác thoải mái khi sử dụng.\r\n📦 Set gồm 10 móng tay + keo dán tiện lợi, dễ dàng gắn tại nhà chỉ trong vài phút.\r\n🌟 Thích hợp cho đi học, đi làm, hẹn hò hay những buổi tiệc, tạo điểm nhấn tinh tế và đáng yêu cho đôi bàn tay.', 55000.00, 20, 1, '2025-09-23 12:51:05', '2025-09-23 12:51:09'),
(44, 2, 'Móng tay giả Fruit Apple đeo nơ ngôi sao nhỏ WY363 set30', '🍎 Bộ móng tay giả Fruit Apple với thiết kế trái táo dễ thương kết hợp chi tiết nơ xinh và ngôi sao nhỏ lấp lánh, mang lại vẻ ngoài tươi trẻ và nổi bật.\r\n✨ Kiểu dáng đáng yêu, màu sắc ngọt ngào, dễ dàng phối hợp với nhiều phong cách trang phục.\r\n💅 Chất liệu móng chắc chắn, ôm khít tự nhiên, không gây khó chịu khi sử dụng.\r\n📦 Set gồm 30 móng tay đa dạng kích thước, dễ dàng lựa chọn vừa vặn cho từng ngón tay + keo dán tiện lợi.\r\n🌟 Phù hợp cho những buổi đi chơi, hẹn hò hay dự tiệc, giúp đôi tay thêm xinh xắn và cuốn hút.', 65000.00, 15, 1, '2025-09-23 12:51:15', '2025-09-23 12:51:18'),
(45, 2, 'Móng tay giả Cute animals fruits and else WY317 set30', '🐾 Bộ móng tay giả Cute Animals Fruits and Else WY317 với thiết kế con vật dễ thương, trái cây ngọt ngào và nhiều chi tiết xinh xắn khác, tạo cảm giác trẻ trung và nổi bật.\r\n🍓 Màu sắc tươi sáng, phong cách đáng yêu, dễ mix với nhiều outfit hằng ngày.\r\n💅 Chất liệu bền, form móng ôm tự nhiên, thoải mái khi sử dụng.\r\n📦 Set gồm 30 móng tay nhiều size, tiện lựa chọn cho từng ngón tay + kèm keo dán.\r\n✨ Thích hợp để đi học, đi chơi, dự tiệc hoặc làm quà tặng cho bạn bè.', 65000.00, 19, 1, '2025-09-23 12:51:21', '2025-09-23 12:51:33'),
(46, 2, 'Móng tay giả Bow nơ quilted pattern WY256 set30', '🎀 Bộ móng tay giả Bow Nơ Quilted Pattern WY256 với thiết kế họa tiết chần bông sang trọng kết hợp nơ xinh xắn, tạo điểm nhấn độc đáo và thời thượng.\r\n✨ Phong cách nữ tính, thanh lịch, dễ phối cùng nhiều outfit từ nhẹ nhàng đến nổi bật.\r\n💅 Chất liệu bền, form móng ôm sát tự nhiên, mang lại cảm giác thoải mái khi sử dụng.\r\n📦 Set gồm 30 móng nhiều size, dễ chọn cho từng ngón tay, kèm keo dán tiện lợi.', 55000.00, 10, 1, '2025-09-23 12:51:30', '2025-09-23 12:51:36'),
(47, 2, 'Móng tay giả đính chi tiết nổi Sanrio family Hello Kitty face đeo nơ chấ m bi kèm keo S90 set10', '🎀 Bộ móng tay giả Sanrio Family – Hello Kitty Face S90 với thiết kế dễ thương, nổi bật hình mặt Hello Kitty đeo nơ đáng yêu cùng họa tiết chấm bi tinh nghịch.\r\n✨ Đính chi tiết nổi 3D tạo hiệu ứng sống động, mang lại phong cách ngọt ngào và trẻ trung.\r\n💅 Chất liệu móng bền đẹp, ôm sát tự nhiên, thoải mái khi đeo.\r\n📦 Set gồm 10 móng nhiều size, kèm keo dán tiện lợi, giúp bạn dễ dàng gắn và tháo ngay tại nhà.', 45000.00, 1, 1, '2025-09-23 12:51:39', '2025-09-23 12:51:42'),
(48, 2, 'Móng tay giả đính chi tiết nổi Sanrio family Hello Kitty face nơ chấm bi mix màu kèm keo S77 set10', '🎀 Bộ móng tay giả Sanrio Family – Hello Kitty Face S77 với thiết kế đáng yêu, nổi bật hình mặt Hello Kitty phối nơ xinh xắn cùng họa tiết chấm bi mix màu tươi sáng.\r\n✨ Đính chi tiết nổi 3D độc đáo, mang lại phong cách ngọt ngào, trẻ trung và cực dễ thương.\r\n💅 Chất liệu móng chắc chắn, bám tốt, ôm khít móng tay thật, tạo cảm giác tự nhiên khi sử dụng.\r\n📦 Set gồm 10 móng nhiều size, đi kèm keo dán tiện lợi, dễ dàng gắn và tháo ngay tại nhà.', 45000.00, 8, 1, '2025-09-23 12:51:57', '2025-09-23 12:52:00'),
