(160, 10, 'Kẹp tóc càng cua Hàn Quốc nữ đẹp hottrend nhám cỡ size lớn iLita - Cặp búi tóc dễ thương cào 10 răng, 14 răng', '🎀 Kẹp tóc càng cua Hàn Quốc iLita, thiết kế nhám hottrend cỡ lớn, phù hợp cho nữ.\r\n✨ Phong cách trẻ trung, dễ thương, thích hợp đi học, đi chơi hoặc tạo kiểu tóc búi năng động.\r\n💎 Chất liệu bền, nhẹ, giữ tóc chắc mà không làm hư tóc, thoải mái khi sử dụng cả ngày.\r\n🌟 Thiết kế 10 răng hoặc 14 răng, dễ dàng cố định tóc, tiện lợi và thời trang.\r\n💖 Lý tưởng làm quà tặng phụ kiện tóc cho bạn bè, người thân hoặc các cô gái yêu thích kiểu tóc búi.\r\n📦 Sản phẩm nhỏ gọn, tiện lợi mang theo và phối hợp với nhiều kiểu tóc, trang phục khác nhau.', 23860.00, 10, 1, '2025-09-24 07:22:33', '2025-09-24 07:22:33'),
(161, 10, 'Set 50 Kẹp Tóc Dễ Thương Ngọt Ngào NOVSET màu xanh cho bé gái phong cách hàn quốc', '🎀 Set 50 kẹp tóc dễ thương ngọt ngào NOVSET màu xanh, phong cách Hàn Quốc, dành cho bé gái.\r\n✨ Thiết kế trẻ trung, đáng yêu, phù hợp đi học, đi chơi hoặc làm điểm nhấn cho tóc.\r\n💎 Chất liệu bền, nhẹ, giữ tóc chắc mà không làm hư tóc, thoải mái khi sử dụng cả ngày.\r\n🌟 Mẫu mã sinh động, độc đáo, tạo vẻ nổi bật và đáng yêu cho các bé gái.\r\n💖 Lý tưởng làm quà tặng phụ kiện tóc cho bạn bè, người thân hoặc bé gái yêu thích phong cách Hàn Quốc.\r\n📦 Bộ gồm 50 kẹp, tiện lợi mang theo và dễ phối hợp với nhiều kiểu tóc, trang phục khác nhau.', 41400.00, 39, 1, '2025-09-24 07:22:33', '2025-09-24 07:22:33'),
(162, 10, 'Kẹp Tóc Hoa sứ NOVSET Kẹp tóc hoa Nhiều Màu Sắc Phong Cách Hawaii', '🎀 Kẹp tóc hoa sứ NOVSET, thiết kế nhiều màu sắc phong cách Hawaii sinh động và tươi mới.\r\n✨ Phong cách nữ tính, dễ thương, phù hợp đi học, đi chơi hoặc dự tiệc.\r\n💎 Chất liệu bền, nhẹ, giữ tóc chắc mà không làm hư tóc, thoải mái khi sử dụng cả ngày.\r\n🌺 Chi tiết hoa sứ nổi bật, tạo điểm nhấn sinh động và cuốn hút ánh nhìn.\r\n💖 Lý tưởng làm quà tặng phụ kiện tóc cho bạn bè, người thân hoặc các cô gái yêu thích phong cách nhiệt đới.\r\n📦 Sản phẩm nhỏ gọn, tiện lợi mang theo và phối hợp với nhiều kiểu tóc, trang phục khác nhau.', 27500.00, 25, 1, '2025-09-24 07:22:33', '2025-09-24 07:22:33'),
(163, 10, 'Kẹp tóc thiết kế tinh tế nhiều màu sắc hấp dẫn làm nổi bật phong cách', '🎀 Kẹp tóc thiết kế tinh tế với nhiều màu sắc hấp dẫn, tạo điểm nhấn nổi bật cho phong cách của bạn.\r\n✨ Phong cách nữ tính, trẻ trung, phù hợp đi học, đi chơi hoặc dự tiệc.\r\n💎 Chất liệu bền, nhẹ, giữ tóc chắc mà không làm hư tóc, thoải mái khi sử dụng cả ngày.\r\n🌟 Kiểu dáng tinh xảo, sang trọng, dễ phối hợp với nhiều kiểu tóc và trang phục khác nhau.\r\n💖 Lý tưởng làm quà tặng phụ kiện tóc cho bạn bè, người thân hoặc các cô gái yêu thích phong cách thời trang.\r\n📦 Sản phẩm nhỏ gọn, tiện lợi mang theo và sử dụng mọi lúc, mọi nơi.', 29720.00, 13, 1, '2025-09-24 07:22:33', '2025-09-24 07:22:33'),
(164, 10, 'Thời Trang Gradient Plumeria Hoa Kẹp Tóc Kẹp Tóc Kẹp Barrettes Phụ Kiện', '🎀 Kẹp tóc thời trang Gradient Plumeria, thiết kế hoa độc đáo kết hợp kẹp barrettes, phụ kiện tóc tinh tế.\r\n✨ Phong cách nữ tính, dễ thương, phù hợp đi học, đi chơi hoặc dự tiệc.\r\n💎 Chất liệu bền, nhẹ, giữ tóc chắc mà không làm hư tóc, thoải mái khi sử dụng cả ngày.\r\n🌸 Chi tiết hoa Plumeria gradient nổi bật, sinh động, tạo điểm nhấn cuốn hút ánh nhìn.\r\n💖 Lý tưởng làm quà tặng phụ kiện tóc cho bạn bè, người thân hoặc các cô gái yêu thích phong cách thời trang.\r\n📦 Sản phẩm nhỏ gọn, tiện lợi mang theo và phối hợp với nhiều kiểu tóc, trang phục khác nhau', 27559.00, 40, 1, '2025-09-24 07:22:33', '2025-09-24 07:22:33'),
(165, 10, 'Kẹp tóc tiểu thư sang chảnh cặp tóc nơ tiểu thư hàn quốc', '🎀 Kẹp tóc tiểu thư sang chảnh, thiết kế cặp tóc nơ phong cách Hàn Quốc tinh tế.\r\n✨ Phong cách nữ tính, thanh lịch, phù hợp đi học, đi chơi hoặc dự tiệc.\r\n💎 Chất liệu bền, nhẹ, giữ tóc chắc mà không làm hư tóc, thoải mái khi sử dụng cả ngày.\r\n🌟 Chi tiết nơ sang trọng, tạo điểm nhấn nổi bật, thanh lịch và cuốn hút ánh nhìn.\r\n💖 Lý tưởng làm quà tặng phụ kiện tóc cho bạn bè, người thân hoặc các cô gái yêu thích phong cách tiểu thư.\r\n📦 Sản phẩm nhỏ gọn, tiện lợi mang theo và phối hợp với nhiều kiểu tóc, trang phục khác nhau.', 29000.00, 48, 1, '2025-09-24 07:22:33', '2025-09-24 07:22:33'),
(166, 10, 'Set 8 món kẹp tóc cỡ lớn xinh xắn thời trang phong cách Hàn Quốc cho bạn gái giúp tóc gọn gàng', '🎀 Set 8 món kẹp tóc cỡ lớn, xinh xắn, thời trang phong cách Hàn Quốc, giúp tóc gọn gàng cho bạn gái.\r\n✨ Phong cách trẻ trung, dễ thương, phù hợp đi học, đi chơi hoặc dự tiệc.\r\n💎 Chất liệu bền, nhẹ, giữ tóc chắc mà không làm hư tóc, thoải mái khi sử dụng cả ngày.\r\n🌟 Kiểu dáng cỡ lớn tiện lợi, dễ dàng kẹp tóc nhiều kiểu, tạo điểm nhấn nổi bật và cuốn hút ánh nhìn.\r\n💖 Lý tưởng làm quà tặng phụ kiện tóc cho bạn bè, người thân hoặc các cô gái yêu thích phong cách Hàn Quốc.\r\n📦 Bộ gồm 8 kẹp tóc, tiện lợi mang theo và phối hợp với nhiều kiểu tóc, trang phục khác nhau.', 29000.00, 29, 1, '2025-09-24 07:22:33', '2025-09-24 07:22:33'),
(167, 10, 'Kẹp Tóc Cá Sấu Cao Cấp Màu Chặn Màu Mới Động Vật Biển Cá Mập Kẹp Phụ Kiện Tóc Trên Mặt Sau Đầu', '🎀 Kẹp tóc cá sấu cao cấp, màu chặn mới, họa tiết động vật biển hình cá mập, phụ kiện tóc độc đáo cho mặt sau đầu.\r\n✨ Phong cách trẻ trung, dễ thương, phù hợp đi học, đi chơi hoặc tạo kiểu tóc năng động.\r\n💎 Chất liệu bền, nhẹ, giữ tóc chắc mà không làm hư tóc, thoải mái khi sử dụng cả ngày.\r\n🐟 Chi tiết cá mập sinh động, nổi bật, tạo điểm nhấn đáng yêu và cuốn hút ánh nhìn.\r\n💖 Lý tưởng làm quà tặng phụ kiện tóc cho bạn bè, người thân hoặc các cô gái yêu thích phụ kiện độc đáo.\r\n📦 Sản phẩm nhỏ gọn, tiện lợi mang theo và phối hợp với nhiều kiểu tóc, trang phục khác nhau.', 30240.00, 26, 1, '2025-09-24 07:22:33', '2025-09-24 07:22:33'),
(168, 10, '2024 Ngọt Ngào Mát y2k Đen Kitty Dễ Thương Chấm Bi Ngôi Sao Lấy Kẹp Cá Mập', '🎀 Kẹp tóc Y2K 2024 ngọt ngào, thiết kế dễ thương với họa tiết Kitty, chấm bi và ngôi sao, màu đen trẻ trung.\r\n✨ Phong cách Y2K đáng yêu, phù hợp đi học, đi chơi hoặc tạo điểm nhấn cho tóc.\r\n💎 Chất liệu bền, nhẹ, kẹp chắc mà không làm hư tóc, thoải mái khi sử dụng cả ngày.\r\n🌟 Thiết kế cá mập tiện lợi, giữ tóc gọn gàng và nổi bật, cuốn hút ánh nhìn.\r\n💖 Lý tưởng làm quà tặng phụ kiện tóc cho bạn bè, người thân hoặc các cô gái yêu thích phong cách Y2K dễ thương.\r\n📦 Sản phẩm nhỏ gọn, tiện lợi mang theo và phối hợp với nhiều kiểu tóc, trang phục khác nhau.', 35660.00, 49, 1, '2025-09-24 07:22:33', '2025-09-24 07:22:33'),
(169, 10, 'Kẹp tóc hoạ tiết nơ cao cấp Kẹp tóc phong cách Hàn Quốc Kẹp búi củ tỏi tầng mây xinh xắn nhẹ nhàng', '🎀 Kẹp tóc họa tiết nơ cao cấp, phong cách Hàn Quốc, thiết kế kẹp búi củ tỏi tầng mây xinh xắn, nhẹ nhàng.\r\n✨ Phong cách nữ tính, thanh lịch, phù hợp đi học, đi chơi hoặc dự tiệc.\r\n💎 Chất liệu bền, nhẹ, giữ tóc chắc mà không làm hư tóc, thoải mái khi sử dụng cả ngày.\r\n🌟 Chi tiết nơ và thiết kế tầng mây tinh tế, tạo điểm nhấn nổi bật và cuốn hút ánh nhìn.\r\n💖 Lý tưởng làm quà tặng phụ kiện tóc cho bạn bè, người thân hoặc các cô gái yêu thích phong cách Hàn Quốc.\r\n📦 Sản phẩm nhỏ gọn, tiện lợi mang theo và phối hợp với nhiều kiểu tóc, trang phục khác nhau.', 27245.00, 37, 1, '2025-09-24 07:22:33', '2025-09-24 07:22:33'),
(170, 10, 'kẹp tóc càng cua NOVSET kẹp tóc hàn quốc đẹp thiết kế kiểu dáng nhựa nhám có chọn màu Mã #KT_16881', '🎀 Kẹp tóc càng cua NOVSET [Mã #KT_16881], thiết kế Hàn Quốc, chất liệu nhựa nhám, kiểu dáng thời trang đẹp mắt.\r\n✨ Phong cách trẻ trung, dễ thương, phù hợp đi học, đi chơi hoặc tạo kiểu tóc năng động.\r\n💎 Chất liệu bền, nhẹ, giữ tóc chắc mà không làm hư tóc, thoải mái khi sử dụng cả ngày.\r\n🌟 Kiểu dáng nhám độc đáo, có thể chọn màu yêu thích, tạo điểm nhấn nổi bật và cuốn hút ánh nhìn.\r\n💖 Lý tưởng làm quà tặng phụ kiện tóc cho bạn bè, người thân hoặc các cô gái yêu thích phong cách Hàn Quốc.\r\n📦 Sản phẩm nhỏ gọn, tiện lợi mang theo và phối hợp với nhiều kiểu tóc, trang phục khác nhau.', 23000.00, 22, 1, '2025-09-24 07:22:33', '2025-09-24 07:22:33'),
(171, 10, 'Kẹp Tóc Chấm Bi Đỏ Đa Năng Nổi Bật', '🎀 Kẹp tóc chấm bi đỏ đa năng, thiết kế nổi bật và dễ thương.\r\n✨ Phong cách trẻ trung, nữ tính, phù hợp đi học, đi chơi hoặc tạo điểm nhấn cho tóc.\r\n💎 Chất liệu bền, nhẹ, giữ tóc chắc mà không làm hư tóc, thoải mái khi sử dụng cả ngày.\r\n🌟 Họa tiết chấm bi đỏ nổi bật, tạo điểm nhấn sinh động và cuốn hút ánh nhìn.\r\n💖 Lý tưởng làm quà tặng phụ kiện tóc cho bạn bè, người thân hoặc các cô gái yêu thích phong cách dễ thương.\r\n📦 Sản phẩm nhỏ gọn, tiện lợi mang theo và phối hợp với nhiều kiểu tóc, trang phục khác nhau.', 31880.00, 26, 1, '2025-09-24 07:22:33', '2025-09-24 07:22:33'),
